import style from 'styled-components';
import home from '../../assets/icon/home.svg';
import home_hover from '../../assets/icon/home_hover.svg';
import conversation from '../../assets/icon/conversation.svg';
import conversation_hover from '../../assets/icon/conversation_hover.svg';
import shopping_cart from '../../assets/icon/shopping-cart.svg';
import shopping_cart_hover from '../../assets/icon/shopping-cart_hover.svg';
import user from '../../assets/icon/user.svg';
import user_hover from '../../assets/icon/user_hover.svg';


const BarWrap = style.div`
    position: fixed;
    top: 158vw;
    width: 100vw;
    height: 20vw;
    background-color: #ffffff;
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    align-items: center;
`;

const BarMenu = style.img`

`;


const UnderBarComponent = ({onHandleClick, value}) => {
    return(
        <>
            <BarWrap>
                <BarMenu onClick={onHandleClick} isClick={value} id={0} isHover={false}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={0} isHover={true}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={1} isHover={false}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={1} isHover={true}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={2} isHover={false}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={2} isHover={true}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={3} isHover={false}/>
                <BarMenu onClick={onHandleClick} isClick={value} id={3} isHover={true}/>
            </BarWrap>
        </>
    );
}

export default UnderBarComponent;
